import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [context, setContext] = useState('');
  const [responseType, setResponseType] = useState(null);
  const [generatedResponse, setGeneratedResponse] = useState(null);
  const [loading, setLoading] = useState(false);
  const [generating, setGenerating] = useState(false);

  const [responseTypeDist, setResponseTypeDist] = useState(null);
  const [selectedResponseType, setSelectedResponseType] = useState(null);


  // const handleSubmit = async () => {
  //   setLoading(true);
  //   setResponseType(null);
  //   setGeneratedResponse(null);
  //   try {
  //     const response = await axios.post('http://localhost:8000/predict', { context });
  //     setResponseType(response.data.response_type);
  //   } catch (error) {
  //     console.error("Prediction failed", error);
  //     setResponseType("Error occurred. Please try again.");
  //   } finally {
  //     setLoading(false);
  //   }
  // };

  const handleSubmit = async () => {
    setLoading(true);
    setResponseTypeDist(null);
    setSelectedResponseType(null);
    setGeneratedResponse(null);
    try {
      const response = await axios.post('http://localhost:8000/predict', { context });
      setResponseTypeDist(response.data.response_type_distribution); // Example: { Advice: 0.4, Empathy: 0.3, Validation: 0.2, Reassurance: 0.1 }
    } catch (error) {
      console.error("Prediction failed", error);
    } finally {
      setLoading(false);
    }
  };


  // const handleGenerate = async () => {
  //   setGenerating(true);
  //   setGeneratedResponse(null);
  //   try {
  //     const response = await axios.post('http://localhost:8000/generate-response', {
  //       context,
  //       response_type: responseType
  //     });
  //     setGeneratedResponse(response.data.generated_response);
  //   } catch (error) {
  //     console.error("Generation failed", error);
  //     setGeneratedResponse("Failed to generate response.");
  //   } finally {
  //     setGenerating(false);
  //   }
  // };
  const handleGenerate = async () => {
    if (!selectedResponseType) return;
    setGenerating(true);
    setGeneratedResponse(null);
    try {
      const response = await axios.post('http://localhost:8000/generate-response', {
        context,
        response_type: selectedResponseType
      });
      setGeneratedResponse(response.data.generated_response);
    } catch (error) {
      console.error("Generation failed", error);
      setGeneratedResponse("Failed to generate response.");
    } finally {
      setGenerating(false);
    }
  };


  return (
    <div style={{
      maxWidth: '700px',
      margin: '40px auto',
      padding: '30px',
      backgroundColor: '#f9fafb',
      borderRadius: '12px',
      boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)'
    }}>
      <h1 style={{ fontSize: '24px', fontWeight: 'bold', marginBottom: '20px' }}>
        üß† Patient Counseling Assistant
      </h1>

      <textarea
        rows="6"
        value={context}
        onChange={(e) => setContext(e.target.value)}
        placeholder="üìù Enter the patient's context here..."
        style={{
          width: '100%',
          padding: '12px',
          borderRadius: '8px',
          border: '1px solid #ccc',
          fontSize: '16px',
          resize: 'vertical'
        }}
      />

      <button
        onClick={handleSubmit}
        disabled={loading}
        style={{
          marginTop: '15px',
          padding: '12px 24px',
          backgroundColor: '#2563eb',
          color: 'white',
          border: 'none',
          borderRadius: '8px',
          cursor: 'pointer',
          fontWeight: 'bold'
        }}
      >
        {loading ? "üîÑ Predicting..." : "üéØ Get Response Type"}
      </button>

      {responseType && (
        <div style={{ marginTop: '25px', fontWeight: 'bold', fontSize: '18px' }}>
          ‚úÖ Suggested Response Type: <span style={{ color: '#2563eb' }}>{responseType}</span>
        </div>
      )}

      {responseType && (
        <button
          onClick={handleGenerate}
          disabled={generating}
          style={{
            marginTop: '20px',
            padding: '10px 20px',
            backgroundColor: '#10b981',
            color: 'white',
            border: 'none',
            borderRadius: '8px',
            cursor: 'pointer',
            fontWeight: 'bold'
          }}
        >
          {generating ? "üß† Generating..." : `üí° Generate Suggested ${responseType}`}
        </button>
      )}

{responseTypeDist && (
  <div style={{ marginTop: '25px' }}>
    <h3 style={{ fontWeight: 'bold', fontSize: '18px' }}>üìä Response Type Distribution:</h3>
    <ul style={{ listStyle: 'none', paddingLeft: 0 }}>
      {Object.entries(responseTypeDist).map(([type, prob]) => (
        <li key={type} style={{ marginBottom: '10px' }}>
          <label>
            <input
              type="radio"
              name="responseType"
              value={type}
              checked={selectedResponseType === type}
              onChange={() => setSelectedResponseType(type)}
              style={{ marginRight: '10px' }}
            />
            <strong>{type}</strong>: {(prob * 100).toFixed(1)}%
          </label>
        </li>
      ))}
    </ul>
  </div>
)}

{selectedResponseType && (
  <button
    onClick={handleGenerate}
    disabled={generating}
    style={{
      marginTop: '20px',
      padding: '10px 20px',
      backgroundColor: '#10b981',
      color: 'white',
      border: 'none',
      borderRadius: '8px',
      cursor: 'pointer',
      fontWeight: 'bold'
    }}
  >
    {generating ? "üß† Generating..." : `üí° Generate Suggested ${selectedResponseType}`}
  </button>
)}


      {generatedResponse && (
        <div style={{
          marginTop: '30px',
          padding: '15px',
          backgroundColor: '#f1f5f9',
          borderRadius: '8px',
          fontSize: '16px',
          lineHeight: '1.5'
        }}>
          üó®Ô∏è <strong>Suggested {responseType}:</strong><br />
          {generatedResponse}
        </div>
      )}
    </div>
  );
}

export default App;
